import React from 'react';

const About = ()=> {
  return (
    <section className="py-20">
      <div className="max-w-6xl mx-auto px-4">
        <h1 className="text-3xl font-bold">About Us</h1>
        <p className="mt-4 text-gray-700 max-w-3xl">With over 10 years delivering residential, commercial, and civil construction projects, StellarBuild combines engineering expertise with strict safety standards and transparent communication. NCA Registered • ISO-aligned processes • Fully insured.</p>
      </div>
    </section>
  );
};

export default About;
